import React from 'react'

const BottomNote = () => {
    return (
        <div style={{"padding-bottom": "6.5vh", "paddingTop": "2vh"}}>
            <h4 className="text-center">
                Note: This Club Invitation is only Extended to Those Who Current Attend LHS.
            </h4>
        </div>
    )
}

export default BottomNote
